import React from 'react'
import styled from 'styled-components'

function Header() {
  return (
    <Container>
    
    <a>
      <img src="/Images/logo.svg"/>
    </a>
    <Menu>
      <a href="#">Model S</a>
       <a href="#">Model Y</a>
       <a href="#">Model X</a>
       <a href="#">Model 3</a>
    </Menu>

    <RIghtMenu>

    </RIghtMenu>
    </Container>
  )
}

export default Header

const Container = styled.div`
 min-height: 60px;
 position: Fixed;
 display: flex;
 align-items: center;
 padding: 0 20px;
 top: 0;
 left: 0;
 right: 0;
`

const Menu = styled.div`
display: flex;
align-items: center;
flex: 1;
justify-content: center;
p  {
  padding: 0 20px;
  font-weight: 600;
  text-transform: uppercase;

}
`
